const Statistics = () => {
    return (
        <div className="stats-wrapper none">
            <button className="stats-wrapper__btn">За день</button>
            <button className="stats-wrapper__btn">За тиждень</button>
            <button className="stats-wrapper__btn">За місяць</button>
            <button className="stats-wrapper__btn">За рік</button>
            <button className="stats-wrapper__btn">За весь час</button>
        </div>
    )
}

export default Statistics;
